def parse_ontology ():
    ont = pronto.Ontology ('/projects/stars/m2m/var/diseaseontology/dis.obo')
    ''' print (ont.json) '''
    hierarchy_map = {}
    for term in ont:
        xref = None
        if 'xref' in term.other:
            for x in term.other['xref']:
                if x.startswith ("MESH:"):
                    xref = x
                    #disease_ont[term.id.upper()] = term
                    lineage = map ( lambda t : t.id, term.rparents ())
                    sorted_lineage = sorted (lineage, key=lambda e : int(e.split(':')[1]))
                    disease = Disease (term=term, xref=xref, lineage=sorted_lineage)
                    hierarchy_map[term.id.upper ()] = disease
                    break
    for k in hierarchy_map:
        print ("{0} {1} {2}".format (k, hierarchy_map[k].mesh_id, hierarchy_map[k].lineage))
    return hierarchy_map

