import numpy as np
from sklearn.metrics import jaccard_similarity_score

def reshape_array (source, target):
    N = np.zeros (target.shape)
    N[:source.shape[0]] = source
    return N

def reshape_arrays (L, R):
    bigger = max (L.size, R.size)
    if bigger == L.size:
        R = reshape_array (R, L)
    else:
        L = reshape_array (L, R)
    return L, R

def make_arrays (A, B):
    L = np.array (A)
    R = np.array (B)
    return reshape_arrays (L, R)

def average_treatment_set_similarity (drug_lists):
    import numpy as np
    from sklearn.metrics import jaccard_similarity_score
    similarities = []
    for index, drug_list in enumerate (drug_lists):
        for index2, drug_list2 in enumerate (drug_lists):
            if index == index2 or len(drug_list) == 0 or len(drug_list2) == 0:
                continue
            L, R = make_arrays (drug_list, drug_list2)
            similarity = jaccard_similarity_score (L, R)
            #print ("   s> {0}".format (similarity))
            #print ("L: {0}".format (L))
            #print ("R: {0}".format (R))
            similarities.append (similarity)
    return np.mean (np.array (similarities))
